import { useEffect } from 'react';
import './App.css';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';

function App() {
  useEffect(()=>{
    Aos.init();
  },[]);
  return (<>
  <h1>hjhajhasd</h1>
    <Header/>
    <main></main>
    <Footer/>
    </>
  );
}

export default App;
